import React from 'react';
import { BrowserRouter ,Routes,Route } from "react-router-dom";
import Navbar from './Navbar';
import Footer from './Footer';



function App (){
  return (
  <BrowserRouter>
    <Routes>
    <Route>
      <Navbar />
      <Footer />
      </Route>
    </Routes>
</BrowserRouter>
  );
}

export default App;
